    super();
    this.state = {
      persons: []
    };
  }

  componentDidMount() {
    axios.get(`https://api.nasa.gov/planetary/earth/imagery`).then(res => {
      const persons = res.data;
      console.log(persons);
      this.setState({ persons });
    });
  }
  render() {
